import { useEffect, useState } from "react";
import axios from "axios";
import { useSelector } from "react-redux";
import { useNavigate } from "react-router";
import Container from '@mui/material/Container';
import {Typography } from '@mui/material';
import { Button } from '@mui/material';

export const History = () => {
    const [data, setData ] = useState([]);
    const user = useSelector(state => state.reducer[0]); 
    const navigate = useNavigate();
    console.log(user);

    useEffect(() => {
    if( window.location.pathname ==='/welcome/multiple' && user.length  === 0 )    {
        return navigate('/');
    }
    async  function getData () {
        let getTransactionDetails = await axios.get(`https://localhost:44322/Transaction/transaction_receipts?accountNumber=${user.accountNumber}`).then(response => setData(response.data)).catch(err => console.log(err, 'error caught during post of account number '));
    }
    getData();
    }, [])
    return (<>
            <Container>
                    <Typography variant="body1" color ='primary' style =  {{marginLeft: 90, marginTop:50, fontSize:20}}>Transfer Details</Typography>
            </Container>
            <Container>
                    <TableContainer style =  {{marginLeft: 100, marginTop:50}} >
                        <Table sx={{ width: '700px' }} aria-label="simple table">
                            <TableHead>
                                <TableRow>
                                    <TableCell>Serial Number</TableCell>
                                    <TableCell>Account Number</TableCell>
                                    <TableCell>Amount</TableCell>
                                    <TableCell>Bank</TableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody>
                                {multipleTransfer && multipleTransfer.map((val,key)  => <TableRow
                                sx={{ '&:last-child td, &:last-child th': { border: 0 } }}>
                                    <TableCell component="th" scope="row">
                                        {key +1}
                                    </TableCell>
                                    <TableCell align="left">{val.receiverAccount}</TableCell>
                                    <TableCell align="left">{val.transactionAmount}</TableCell>
                                    <TableCell align="left">{val.bank}</TableCell>
                                </TableRow>)}
                            </TableBody>
                        </Table>
                    </TableContainer>
                </Container>
            
        </>);
}
